import React from "react";
import ListItem from "./listItem_comp";

const List = ({todos,setTodo}) =>{
    return(
        <ul>
            {
                todos.map(todo => <ListItem setTodo={setTodo} todos={todos} todo={todo} id={todo.id} key={todo.id}/>)
            }
        </ul>
    )
}

export default  List;
